local type_string_to_type <const> = { -- Does not support "any" type.
	cam = "__tointeger",
	entity = "__tointeger",
	player = "__tointeger",
	vehicle = "__tointeger",
	object = "__tointeger",
	ped = "__tointeger",
	pickup = "__tointeger",
	hash = "__tointeger",
	int = "__tointeger",
	bool = "__tointeger",
	["const char*"] = "__tostring",
	float = "__tonumber",
	vector3 = "__tov3",
	void = "void"
} -- Not all types have been added to this list. Add more as needed.

local function parse_type(native_result, Type)
	assert(type_string_to_type[Type], "Missing type in map.", Type) -- Stack overflow if essentials.assert
	local result
	if type_string_to_type[Type] == "__tostring" then
		result = native_result[type_string_to_type[Type]](native_result, true)
	else
		result = type_string_to_type[Type] ~= "void" and native_result[type_string_to_type[Type]](native_result) or nil
	end
	if Type == "bool" then
		result = result ~= 0
	end
	return result
end

local function parse_parameters(pars, ...)
	local args <const> = {}
	local buffers <const> = {}
	local find <const> = string.find
	local select <const> = select
	local current_par = 1
	for par in pars:gmatch("([^,]+) ") do
		if select(current_par, ...) == nil and find(par, "*", 1, true) and not find(par, "const", 1, true) then
			if find(par, "vector3", 1, true) then
				args[#args + 1] = native.ByteBuffer32()
				buffers[#buffers + 1] = {type = "v3", buffer = args[#args]}
			elseif find(par, "char", 1, true) then
				args[#args + 1] = native.ByteBuffer128() -- Might need 256 byte buffer for certain functions, but I reckon 128 bytes is enough most of the time.
				buffers[#buffers + 1] = {type = "string", buffer = args[#args]}
			elseif find(par, "float", 1, true) then
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "float", buffer = args[#args]}
			elseif find(par, "bool", 1, true) then
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "bool", buffer = args[#args]}
			elseif find(par, "any", 1, true) then
				args[#args + 1] = native.ByteBuffer32()
				buffers[#buffers + 1] = {type = "any", buffer = args[#args]}				
			else
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "integer", buffer = args[#args]}
			end
		elseif find(par, "*", 1, true) then
			args[#args + 1] = native.ByteBuffer32(select(current_par, ...))
		else
			args[#args + 1] = select(current_par, ...)
		end
		current_par = current_par + 1
	end
	return args, buffers
end

do
--[[ 
	
	Integrates all natives into the global space.

	Any functions that needs buffers to return values are implicitly converted into a regular lua function returning multiple values.
	Check out kek_entity.get_entity_proofs to see this in action.

	It makes function calls 3x slower. 120k calls per second to 40k calls. (_get_entity_proofs)
	If the function have an any* parameter, you must handle the type interpreting yourself.
	If you pass a parameter where buffers are, it will no longer interpret it as a buffer. 
	network.network_handle_from_player(pid, nil, 13) -- second par is interpreted as a buffer
	network.network_handle_from_player(pid, SOME_BUFFER, 13) second par is no longer a buffer, but an argument bytebuffer instead
	To be clear, "buffers" are what the function will return. So, if something is no longer a buffer, it returns less.
	network.network_member_id_from_gamer_handle(buf) expects a buffer as parameter, but not to return with it.

	There are a few functions that takes pointers as normal arguments and not purely a buffer. Those functions won't work by default.
	It is really easy to make them just do native.call. I won't be supporting those functions unless I happen to need one of them.

	If the api already have a function with the same name, it's not overwritten, but instead, added as: native_name .. "__native"
	NATIVES ACCEPT V3, EVEN IF IT ASKS FOR X,Y,Z ARGS. IN SOME CASES, YOU MUST USE V3 FOR IT TO WORK. (set_entity_rotation__native)
--]]

	local _G_mt -- Debugger.lua raises error if messing with _G
	if debug.getmetatable(_G) then
		_G_mt = debug.getmetatable(_G)
		setmetatable(_G, nil)
	end

	for category_name, category in pairs(ids) do
		local mt
		if _G[category_name] then -- Checks if 2take1's api have a table with the name
			mt = debug.getmetatable(_G[category_name])
			setmetatable(_G[category_name], nil)
		else
			_G[category_name] = {}
		end
		for native_name, info in pairs(category) do

			if _G[category_name][native_name] then
				native_name = native_name.."__native"
			end

			if not _G[category_name][native_name] then
				_G[category_name][native_name] = 
					info.pars:find("*", 1, true) and 
				function(...)
					local args <const>, buffers <const> = parse_parameters(info.pars, ...)
					local return_value
					if info.type == "any" then
						return_value = native.call(info.id, table.unpack(args))
					else
						return_value = parse_type(native.call(info.id, table.unpack(args)), info.type)
					end

					for i = 1, #buffers do
						if buffers[i].type == "v3" then
							buffers[i] = buffers[i].buffer:__tov3()
						elseif buffers[i].type == "string" then
							buffers[i] = buffers[i].buffer:__string(true)
						elseif buffers[i].type == "float" then
							buffers[i] = buffers[i].buffer:__tonumber()
						elseif buffers[i].type == "bool" then
							buffers[i] = buffers[i].buffer:__tointeger64() == 1
						elseif buffers[i].type == "any" then
							buffers[i] = buffers[i].buffer
						else
							buffers[i] = buffers[i].buffer:__tointeger64()
						end
					end
					if type_string_to_type[info.type] ~= "void" then
						return return_value, table.unpack(buffers)
					else
						return table.unpack(buffers)
					end
				end or function(...)
					if info.type == "any" then
						return native.call(info.id, ...)
					else
						return parse_type(native.call(info.id, ...), info.type)
					end
				end
			end
		end
		if mt then
			setmetatable(_G[category_name], mt)
		end
	end
	if _G_mt then
		setmetatable(_G, _G_mt)
	end
end

return natives